const Title = () => {
    let csst1 = {
        marginTop: "70px",
        textAlign: "center",
        lineHeight: 1.5,
        letterSpacing: '+0.05em'
    };

    return (
        <>
            <h1 style={csst1} >
                제대로 된 셰프의 <br /> 제대로 만든 초밥을 즐기다.
            </h1>
        </>
    );
};

export default Title;
